import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <div className='footer'>
      <div className='footerSection_01'>
        <div className='aboutPlus__social-media'>
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries....</p>
          <div className='socialMedia_icon' >
            <div className='Icon-media'><i className="fa fa-facebook-f"></i></div>
            <><i class="fa fa-twitter"></i></>
            <><i class="fa fa-instagram"></i></>
            <><i class="fa fa-linkedin"></i></>
            <><i class="fa fa-pinterest"></i></>
          </div>
        </div>
        <div className='onlineShopping'>btbnjibnijtb</div>
        <div className='customerPolicy'>bnjbnijkg</div>
        <div className='storeInformation'>bhjbhijrg</div>
      </div>
      {/* <div className='footerSection_02'></div> */}

    </div>
  )
}

export default Footer;
